import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { FaRocket, FaCloud, FaShieldAlt, FaExpandArrowsAlt, FaBrain, FaCode } from 'react-icons/fa';

const FeatureCard = ({ icon: Icon, title, description }) => (
  <motion.div 
    className="bg-gray-800 bg-opacity-50 p-6 rounded-lg backdrop-filter backdrop-blur-sm"
    whileHover={{ y: -5, boxShadow: "0 10px 20px rgba(0,0,0,0.2)" }}
  >
    <Icon className="text-indigo-400 w-8 h-8 mb-4" />
    <h3 className="text-xl font-semibold text-white mb-2">{title}</h3>
    <p className="text-gray-300 text-sm">{description}</p>
  </motion.div>
);

const AnimatedNumber = ({ value, label }) => {
  const [count, setCount] = useState(0);

  React.useEffect(() => {
    let start = 0;
    const end = parseInt(value.substring(0, 3));
    if (start === end) return;

    let totalMiliseconds = Math.floor(2000 / end);
    let timer = setInterval(() => {
      start += 1;
      setCount(start);
      if (start === end) clearInterval(timer);
    }, totalMiliseconds);

    return () => clearInterval(timer);
  }, [value]);

  return (
    <div className="text-center">
      <div className="text-4xl font-bold text-indigo-400 mb-2">
        {count}{value.substring(3)}
      </div>
      <div className="text-gray-300">{label}</div>
    </div>
  );
};

function Info2() {
  const features = [
    { icon: FaBrain, title: "AI Integration", description: "Seamlessly integrate AI into your workflows" },
    { icon: FaCloud, title: "Cloud Optimization", description: "Optimize your cloud infrastructure" },
    { icon: FaShieldAlt, title: "Secure Development", description: "Build with security at the forefront" },
    { icon: FaExpandArrowsAlt, title: "Scalable Architecture", description: "Design systems that grow with your business" },
    { icon: FaCode, title: "Smart Coding", description: "Intelligent code suggestions and auto-completion" },
    { icon: FaRocket, title: "Rapid Deployment", description: "Deploy your applications faster than ever" },
  ];

  const stats = [
    { value: "99%", label: "Customer Satisfaction" },
    { value: "500+", label: "Enterprise Clients" },
    { value: "50M+", label: "Lines of Code Optimized" },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 to-black text-white overflow-hidden py-20 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-5xl font-bold mb-6 bg-clip-text text-transparent bg-gradient-to-r from-indigo-400 to-purple-500">
            Elevate Your Development Experience
          </h2>
          <p className="text-xl text-gray-300 max-w-3xl mx-auto">
            Discover how TokTok's innovative solutions can transform your software development process.
          </p>
        </motion.div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8 mb-20">
          {features.map((feature, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              <FeatureCard {...feature} />
            </motion.div>
          ))}
        </div>

        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="bg-indigo-900 bg-opacity-50 rounded-xl p-8 mb-20"
        >
          <h3 className="text-3xl font-bold mb-8 text-center">Our Impact</h3>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            {stats.map((stat, index) => (
              <AnimatedNumber key={index} {...stat} />
            ))}
          </div>
        </motion.div>

        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-center"
        >
          <h3 className="text-3xl font-bold mb-6">Ready to Revolutionize Your Development?</h3>
          <p className="text-xl text-gray-300 mb-8 max-w-2xl mx-auto">
            Join thousands of companies that have accelerated their growth with TokTok's innovative solutions.
          </p>
          <motion.button 
            className="bg-gradient-to-r from-indigo-600 to-purple-600 text-white px-8 py-3 rounded-full font-medium text-lg shadow-lg"
            whileHover={{ scale: 1.05, boxShadow: "0 0 20px rgba(129, 140, 248, 0.5)" }}
            whileTap={{ scale: 0.95 }}
          >
            Start Your Journey
          </motion.button>
        </motion.div>
      </div>

      <div className="absolute top-0 left-0 w-full h-full overflow-hidden pointer-events-none">
        {[...Array(20)].map((_, i) => (
          <motion.div
            key={i}
            className="absolute bg-indigo-500 rounded-full opacity-10"
            style={{
              width: Math.random() * 300 + 50,
              height: Math.random() * 300 + 50,
              top: `${Math.random() * 100}%`,
              left: `${Math.random() * 100}%`,
            }}
            animate={{
              y: [0, Math.random() * 100 - 50],
              opacity: [0.1, 0.3, 0.1],
            }}
            transition={{
              duration: Math.random() * 10 + 10,
              repeat: Infinity,
              repeatType: "reverse",
            }}
          />
        ))}
      </div>
    </div>
  );
}

export default Info2;
